import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const CarUpdateScreen = () => {
    const { carId } = useParams(); // Get the carId from the URL
    const [carDetails, setCarDetails] = useState(null);

    useEffect(() => {
        // Fetch car data using the carId
        axios.get(`http://localhost:8081/api/cars/${carId}`)
            .then((response) => {
                setCarDetails(response.data);
            })
            .catch((error) => {
                console.error('Error fetching car data:', error);
            });
    }, [carId]); // Dependency array ensures data is fetched when carId changes

    return (
        <div>
            <h2>Update Car Details</h2>
            {carDetails ? (
                <div>
                    <p><strong>Name:</strong> {carDetails.name}</p>
                    <p><strong>Model:</strong> {carDetails.model}</p>
                    <p><strong>Basic Amount:</strong> {carDetails.basicAmount}</p>
                    <p><strong>Tax:</strong> {carDetails.tax}</p>
                    <p><strong>Max Amount:</strong> {carDetails.maxAmount}</p>
                </div>
            ) : (
                <p>Loading...</p>
            )}
        </div>
    );
};

export default CarUpdateScreen;
